import React from 'react';
import '../App.css';

class Home extends React.Component {

  render() {
    return (
        <div className="App"  style="background-image: url('img_girl.jpg');">
          <header className="bg-danger text-center py-5 mb-4">
            <div className="container">
              <h1 className="font-weight-light text-white">Your Books</h1>
            </div>
          </header>
        </div>
    );
  }
}

export default Home;
